import pandas as pd
from pandas.api.typing import NAType, NaTType
from hypothesis import given, strategies as st

@given(st.integers())
def test_nattype_singleton_inconsistency(x):
    nat = NaTType()
    assert nat is pd.NaT, f"NaTType() should return pd.NaT singleton, but got {nat} instead"

@given(st.integers())
def test_nattype_equality_broken(x):
    nat1 = NaTType()
    nat2 = NaTType()
    assert nat1 == nat2, f"NaTType() instances should be equal, but {nat1} != {nat2}"

@given(st.integers())
def test_nattype_not_recognized_as_missing(x):
    nat = NaTType()
    assert pd.isna(nat), f"NaTType() should be recognized as missing by pd.isna(), but pd.isna({nat}) = {pd.isna(nat)}"

# Run the tests
if __name__ == "__main__":
    print("Testing NaTType singleton inconsistency...")
    try:
        test_nattype_singleton_inconsistency()
        print("✓ test_nattype_singleton_inconsistency passed")
    except AssertionError as e:
        print(f"✗ test_nattype_singleton_inconsistency failed: {e}")

    print("\nTesting NaTType equality...")
    try:
        test_nattype_equality_broken()
        print("✓ test_nattype_equality_broken passed")
    except AssertionError as e:
        print(f"✗ test_nattype_equality_broken failed: {e}")

    print("\nTesting NaTType missing value detection...")
    try:
        test_nattype_not_recognized_as_missing()
        print("✓ test_nattype_not_recognized_as_missing passed")
    except AssertionError as e:
        print(f"✗ test_nattype_not_recognized_as_missing failed: {e}")
